import { useState } from 'react';
import styles from './StudentPage.module.css';

const StudentPage = () => {
    const [isListening, setIsListening] = useState(false);
    const [selectedLecture, setSelectedLecture] = useState<string | null>(null);

    const lectures = [
        { id: '1', title: 'Введение в биологию' },
        { id: '2', title: 'Основы химии' },
        { id: '3', title: 'Физика для начинающих' },
    ];

    const handleStartListening = () => {
        if (!selectedLecture) return;
        setIsListening(true);
    };

    const handleStopListening = () => {
        setIsListening(false);
    };

    const handleRefresh = () => {
        // Логика обновления
    };

    return (
        <div className={styles.container}>
            <div className={styles.sidebar}>
                {/* <h2 className={styles.sectionTitle}>Выбор лекции</h2>
                <div className={styles.note}>Сейчас нет активных лекций</div>
                <div className={styles.note}>Записи лекций:</div>
                <ul className={styles.lectureList}>
                    {lectures.map((lecture) => (
                        <li
                            key={lecture.id}
                            className={`${styles.lectureItem} ${selectedLecture === lecture.id ? styles.lectureItemActive : ''
                                }`}
                            onClick={() => setSelectedLecture(lecture.id)}
                        >
                            {lecture.title}
                        </li>
                    ))}
                </ul> */}
            </div>

            <div className={styles.content}>
                <div className={styles.header}>
                    <h1 className={styles.title}>Слушатель лекции</h1>
                    <h2 className={styles.subtitle}>Просмотр лекции в реальном времени (только чтение)</h2>
                </div>

                <div className={styles.section}>
                    <div className={styles.buttonGroup}>
                        <button
                            onClick={handleStartListening}
                            disabled={!selectedLecture || isListening}
                            className={`${styles.button} ${styles.buttonPrimary}`}
                        >
                            Начать прослушивание
                        </button>
                        <button
                            onClick={handleStopListening}
                            disabled={!isListening}
                            className={`${styles.button} ${styles.buttonDanger}`}
                        >
                            Остановить прослушивание
                        </button>
                        <button
                            onClick={handleRefresh}
                            className={`${styles.button} ${styles.buttonSecondary}`}
                        >
                            Обновить
                        </button>
                    </div>
                    <div className={styles.note}>
                        Выберите лекцию и нажмите "Начать прослушивание"
                    </div>
                </div>

                <div className={styles.divider}></div>

                <div className={styles.section}>
                    <h3 className={styles.sectionTitle}>Как использовать:</h3>
                    <ol>
                        <li>Выберите лекцию в боковой панели</li>
                        <li><strong>Нажмите "Начать прослушивание"</strong></li>
                        <li>Следите за текстом в реальном времени</li>
                        <li>Остановите когда захотите</li>
                    </ol>
                </div>

                <div className={styles.divider}></div>

                <div className={styles.section}>
                    <h3 className={styles.sectionTitle}>Преимущества режима слушателя:</h3>
                    <ul className={styles.featureList}>
                        <li className={styles.featureItem}>
                            <span className={styles.featureCheckbox}></span>
                            Только получение текста (экономия ресурсов)
                        </li>
                        <li className={styles.featureItem}>
                            <span className={styles.featureCheckbox}></span>
                            Быстрое подключение к любой лекции
                        </li>
                        <li className={styles.featureItem}>
                            <span className={styles.featureCheckbox}></span>
                            Автоматическая очистка старых сообщений
                        </li>
                        <li className={styles.featureItem}>
                            <span className={styles.featureCheckbox}></span>
                            Оптимизированно для сотен пользователей
                        </li>
                    </ul>
                </div>
            </div>
        </div>
    );
};

export default StudentPage;
